import {  StyleSheet, View, TextInput ,Text,Button  } from 'react-native';
import { Formik } from 'formik';

function ReviewForm(){
  return(
    <View>
    <Formik 
      initialValues={{hours: "",minute:"",second:"", date:"" }} 
      onSubmit={(values)=>{console.log(values)}}>

        {(props)=>(
          <View style={styles.inputRow}>
            <TextInput 
              style={styles.inputWatch} 
              onChangeText={props.handleChange('hours')} 
              placeholder='HH' 
              keyboardType="numeric" 
              value={props.values.hours}
            />
            <TextInput 
            style={styles.inputWatch} 
            onChangeText={(props)=>{handleChange('minute')}} 
            placeholder='MM' 
            keyboardType="numeric" 
            value={props.values.minute}
            />
            <TextInput 
            style={styles.inputWatch} 
            onChangeText={(props)=>{handleChange('second')}} 
            placeholder='SS' 
            keyboardType="numeric" 
            value={props.values.second}/>

            <Button 
            style={styles.save} 
            title="Save" 
            onPress={props.handleSubmit} ></Button>

          </View>

          



        )}


      <View style={styles.inputRow}>
        <Text>Time</Text>
        <TextInput style={styles.inputWatch} onChangeText={()=>{}} placeholder='HH' keyboardType="numeric" value=''/>
        <TextInput style={styles.inputWatch} onChangeText={()=>{}} placeholder='MM' keyboardType="numeric" value=''/>
        <TextInput style={styles.inputWatch} onChangeText={()=>{}} placeholder='SS' keyboardType="numeric" value=''/>
     </View>
      <View style={styles.inputRow}>
        <Text>Date</Text>
        <TextInput style={styles.inputDate}  onChange={()=>{}} placeholder='09/01/2021'/>
      </View>
        <Button style={styles.save} title="Save" onPress={()=>{}} ></Button>

        </Formik>
   </View>


    
    
  )
}

const styles = StyleSheet.create({
  inputRow:{
    flexDirection:"row",
    marginTop:5
    
  },
  inputWatch:{
    width: 35,
    padding: 3,
    marginLeft:3,
    borderWidth:2,
    borderColor:'black',
  },
  inputDate:{
    width: 100,
    height: 35,
    borderBottomColor:'black',
    borderBottomStartRadius:2,
    borderBottomWidth:2,
    marginLeft:3,
    padding: 10,
  },
  save:{
    marginVertical:10,
    backgroundColor: "red",
  }
});


export default ReviewForm;
